import React from "react";
import style from "./summary.module.css";
import Images from "../images/Images";

function Summary() {
  return (
    <div className="container">
      <div className="row">
        <div className={style["col-md-3 card-like"]}>tt</div>
        <div className={style["card-like"]}>sss</div>
        <div className={style["card-like col-md-3"]}>
          <Images />
        </div>
      </div>
    </div>
  );
}
export default Summary;
